import React, { useState } from 'react';
import { Table } from 'antd';
import { data } from './data'
import {
  DesktopOutlined,
  FileOutlined,
  PieChartOutlined,
  TeamOutlined,
  UserOutlined,
} from '@ant-design/icons';
import { Breadcrumb, Layout, Menu, theme } from 'antd';
const { Header, Content, Footer, Sider } = Layout;
function getItem(label, key, icon, children) {
  return {
    key,
    icon,
    children,
    label,
  };
}

//side bar


//table
const columns = [
  {
    title: 'App Name',
    dataIndex: 'app_name',
    key: 'app_name',
  },
  {
    title: 'Username',
    dataIndex: 'username',
    key: 'username',
  },
  {
    title: 'Password',
    dataIndex: 'password',
    key: 'password',
  },
];

const App = () => {
  return <Table dataSource={data} columns={columns} rowKey="app_name" />;
};

export default App;
